import { useEffect, useState } from "react";
import "./Accordion/Accordion.css";
import MYCONSTANT from "../constant/constant";
import JSONPretty from "react-json-pretty";
var JSONPrettyMon = require("react-json-pretty/dist/monikai");
var jsonxml = require('jsontoxml');

export default function Paths(props) {
  const [path, setPath] = useState([]);
  const [pathSelected, setPathSelected] = useState(null);
  const [flag, setFlag] = useState(true);
 const [change, setChange]= useState("");
  useEffect(() => {
    setPath(props?.path);
  }, [props]);

  const pathToggle = (i) => {
    if (pathSelected === i) {
      return setPathSelected(null);
    }
    setPathSelected(i);
  };

  const getFlag = () => {
    setFlag(!flag);
  };

  // const setMethodColor = (m, border, bg) => {
  //   if (border && border) {
  //     return m === MYCONSTANT.POST
  //       ? "bg-green-" + bg + " border-green-" + border
  //       : m === MYCONSTANT.PUT
  //       ? "bg-orange-" + bg + " border-orange-" + border
  //       : m === MYCONSTANT.GET
  //       ? "bg-sky-" + bg + " border-sky-" + border
  //       : "bg-red-" + bg + " border-red-" + border;
  //   }
  //   return m === MYCONSTANT.POST
  //     ? "border-green-" + border
  //     : m === MYCONSTANT.PUT
  //     ? "border-orange-" + border
  //     : m === MYCONSTANT.GET
  //     ? "border-sky-" + border
  //     : "border-red-" + border;
  // };
 
  function changeResponse(event){
    setChange(event.target.value)
  }
  console.log(path);
  return (
    <>
      {Object.entries(path).map((data, i) =>
        Object.entries(data[1])?.map((method, k) =>
          props.tagName.name === method[1].tags[0] ? (
            <div
              className={method[0] === MYCONSTANT.POST
                ? "border-green-300 border my-2"
                : method[0] === MYCONSTANT.PUT
                ? "border-orange-300 border my-2"
                : method[0] === MYCONSTANT.GET
                ? "border-sky-300 border my-2"
                : "border-red-300 border my-2"}
              key={i}
            >
              <div
                className={method[0] === MYCONSTANT.POST
                  ? "flex p-2 bg-green-200 border-green-300 border text-black"
                  : method[0] === MYCONSTANT.PUT
                  ? "flex p-2 bg-orange-200 border-orange-300 border text-black"
                  : method[0] === MYCONSTANT.GET
                  ? "flex p-2 bg-sky-200 border-sky-300 border text-black"
                  : "flex p-2 bg-red-200 border-red-300 border text-black"}
                onClick={() => pathToggle(i)}
              >
                <div>
                  <span
                    className={ method[0] === MYCONSTANT.POST
                      ? "bg-green-400 border-green-500 border font-bold text-white py-1 px-4 rounded-sm uppercase"
                      : method[0] === MYCONSTANT.PUT
                      ? "bg-orange-400 border-orange-500 border font-bold text-white py-1 px-4 rounded-sm uppercase"
                      : method[0] === MYCONSTANT.GET
                      ? "bg-sky-400 border-sky-500 border font-bold text-white py-1 px-4 rounded-sm uppercase"
                      : "bg-red-400 border-red-500 border font-bold text-white py-1 px-4 rounded-sm uppercase"}
                  >
                    {method[0] !== null ? method[0] : null}
                  </span>

                  <strong className="p-4">{data[0]}</strong>
                  <span>{method[1].summary}</span>
                </div>
                <span>{pathSelected === i ? "-" : "+"}</span>
              </div>
              <div
                className={
                  pathSelected === i
                  ? method[0] === MYCONSTANT.POST
                  ? "content show bg-green-200 border-green-300"
                  : method[0] === MYCONSTANT.PUT
                  ? "content show bg-orange-200 border-orange-300"
                  : method[0] === MYCONSTANT.GET
                  ? "content show bg-sky-200 border-sky-300"
                  : "content show bg-red-200 border-red-300"
                : method[0] === MYCONSTANT.POST
                ? "content hide bg-green-200 border-green-300"
                : method === MYCONSTANT.PUT
                ? "content hide bg-orange-200 border-orange-300"
                : method[0] === MYCONSTANT.GET
                ? "content hide bg-sky-200 border-sky-300"
                : "content hide bg-red-200 border-red-300"
                }
              >
                <div className="flex bg-white text-black p-4 shadow-md">
                  <div>{MYCONSTANT.PARAMETERS}</div>
                  <div
                    className="border-black border-2 p-1 rounded-sm"
                    onClick={() => getFlag()}
                  >
                    {flag ? MYCONSTANT.TRY : MYCONSTANT.CANCEL}
                  </div>
                </div>
                <div className="text-black px-2">
                  <table className="table-auto">
                    <thead>
                      <tr>
                        <th className="w-20">{MYCONSTANT.NAME}</th>
                        <th>{MYCONSTANT.DESCRIPTION}</th>
                      </tr>
                    </thead>
                    <tbody>
                      {method[1].parameters.length <= 1 ? (
                        <tr>
                          <td className="w-20">
                            <p>
                              <b>{method[1]?.parameters[0]?.name}</b>
                              <small className="text-red-900">
                                <sup>
                                  {method[1]?.parameters[0]?.name !== undefined
                                    ? MYCONSTANT.REQUIRED
                                    : null}
                                </sup>
                              </small>
                            </p>
                            &nbsp;
                          </td>
                          <td>
                            <small>{method[1]?.summary}</small>
                            <p>
                              <small>
                                {method[1]?.description === ""
                                  ? method[1]?.parameters[0]?.description
                                  : method[1]?.description}
                              </small>
                            </p>
                            {method[1]?.parameters[0]?.type ===
                              MYCONSTANT.STRING ||
                            method[1]?.parameters[0]?.type ===
                              MYCONSTANT.INTEGER ? (
                              <div>
                                <small>
                                  <input
                                    type="text"
                                    className="p-0"
                                    value={method[1]?.parameters[0]?.type}
                                    disabled="true"
                                  />
                                </small>
                              </div>
                            ) : method[1]?.parameters[0]?.type ===
                              MYCONSTANT.FILE ? (
                              <div>
                                <p>
                                  <small>
                                    <input
                                      type="file"
                                      className="p-0"
                                      id="file"
                                      name="file"
                                      accept="image/png, image/jpeg"
                                      disabled="true"
                                    />{" "}
                                  </small>
                                </p>
                              </div>
                            ) : method[1]?.parameters[0]?.type ===
                              MYCONSTANT.ARRAY ? (
                              <textarea
                                disabled="true"
                                value={Object.keys(method[1]?.parameters[0])}
                              ></textarea>
                            ) : (
                              <div className="overflow-hidden w-96">
                                {change ===  MYCONSTANT.SELECTEDRESPONSE?
                                <div className="bg-black text-white">{jsonxml(method[1]?.parameters[0], true)}</div>:
                                <JSONPretty
                                  id="json-pretty"
                                  className="overflow-hidden"
                                  theme={JSONPrettyMon}
                                  data={method[1]?.parameters[0]}
                                ></JSONPretty>
                                }
                                
                              </div>
                            )}
                          </td>
                        </tr>
                      ) : (
                        method[1].parameters.map((p) => (
                          <tr>
                            <td>
                              <small>
                                {p.name + " (" + p.type + ")"}
                                <small className="text-red-900">
                                  <sup>{MYCONSTANT.REQUIRED}</sup>
                                </small>
                              </small>
                              &nbsp;
                            </td>
                            <td>
                              <small>{method[1]?.summary}</small>
                              <p>
                                <small>{p.description}</small>
                              </p>
                              {p.type === MYCONSTANT.STRING ||
                              p.type === MYCONSTANT.INTEGER ? (
                                <div>
                                  <small>
                                    <input
                                      type="text"
                                      className="p-0"
                                      value={p.type}
                                      disabled="true"
                                    />
                                  </small>
                                </div>
                              ) : p.type === MYCONSTANT.FILE ? (
                                <div>
                                  <small>
                                    <input
                                      type="file"
                                      className="p-0"
                                      id="file"
                                      name="file"
                                      accept="image/png, image/jpeg"
                                      disabled="true"
                                    />{" "}
                                  </small>
                                </div>
                              ) : p.type === MYCONSTANT.BODY ? (
                                <div>
                                  <div className="border-2 border-black p-4">
                                    {""}
                                  </div>
                                </div>
                              ) : p.type === MYCONSTANT.ARRAY ? (
                                MYCONSTANT.ARRAY ? (
                                  <p>
                                    <textarea disabled="true"></textarea>
                                  </p>
                                ) : (
                                  ""
                                )
                              ) : (
                                ""
                              )}
                            </td>
                          </tr>
                        ))
                      )}
                    </tbody>
                  </table>
                </div>
                <div className="flex self-center bg-white text-black my-2 py-2">
                  <div className="m-auto ">
                    <p>{MYCONSTANT.PARAMETER_CONTENT_TYPE}</p>
                    <select onChange={changeResponse} className="w-46 border-solid border-2 border-zinc-500 ">
                      {method[1]?.produces.map((v, i) => (
                        <option  value={v} key={v}>
                          {v}
                        </option>
                      ))}
                    </select>
                  </div>
                </div>

                <div className="flex text-black mt-8 p-4">
                  <div>{MYCONSTANT.RESPONSE} </div>
                  <div className="">
                    {MYCONSTANT.RESPONSE_CONTENT_TYPE}
                    <select className="w-46 border-solid border-2 border-zinc-500 ">
                      {method[1]?.produces.map((v, i) => (
                        <option value={v} key={i}>
                          {v}
                        </option>
                      ))}
                    </select>
                  </div>
                </div>
                <div className="text-black p-2">
                  <table className="table-auto w-100">
                    <thead className="border-collapse">
                      <tr>
                        <th className="w-20">{MYCONSTANT.CODE}</th>
                        <th>{MYCONSTANT.DESCRIPTION}</th>
                      </tr>
                    </thead>
                    <tbody>
                      {Object.entries(method[1]?.responses).map((v, i) =>
                        v.map((d, j) => (
                          <tr>
                            <td className="w-20">{d.description ? v[0] : null} &nbsp;</td>
                            <td>{d.description}</td>
                          </tr>
                        ))
                      )}
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
          ) : null
        )
      )}
    </>
  );
}
